import React from "react";
import phone from "./img/cards-icons/phone5.png";

const Calculator = () => {
  return (
    <>
      <div id="contact">
        {/* <!-- Button trigger modal --> */}
        <a href="tel:+918828507441">
          <button type="button" className="contact__btn">
            Call us
          </button>
        </a>

        <a href="https://wa.me/918369272829?text=hello asstha elevator">
        <button type="button" id="enquiry" class=" btn btn-primary">
          <i class="bi bi-whatsapp"></i>
          Whatsapp
        </button>
        </a>
      </div>
    </>
  );
};

export default Calculator;
